import React from "react";
import { Link } from "react-router-dom";
import "./inside-house.css";

const InsideHouse = () => {
  return (
    <div className="house-lobby-container">
      <ul className="house-lobby--ul">
        <li>
          <Link to="/left-room" className="arrow left">
            Left room
          </Link>
        </li>
        <li>
          <Link to="/game-over" className="arrow up">
            Center room
          </Link>
        </li>
        <li>
          <Link to="/house" className="arrow down">
            Return
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default InsideHouse;
